    fmla_leave                                 varchar2(10 byte),
    fmla_tax                                   varchar2(10 byte),
    fmla_under_cobra                           varchar2(10 byte),
    fmla_return_leave                          varchar2(10 byte),
    fmla_contribution                          varchar2(10 byte),
