    other_max_contrib                          varchar2(100 byte),
    flex_credit_flag                           varchar2(10 byte),
    flex_credit_cash                           varchar2(100 byte),
    flex_cash_amt                              varchar2(100 byte),
    er_contrib_flex                            varchar2(100 byte),
    flex_contrib_amt                           varchar2(100 byte),
    other_flex_amt                             varchar2(100 byte),
    cash_out_amt                               varchar2(100 byte),
    max_flex_cash_out                          varchar2(100 byte),
    dollar_amt                                 varchar2(100 byte),
    other_max_cash_out                         varchar2(100 byte),
    amt_distrib                                varchar2(100 byte),
    min_contrib_hsa                            varchar2(100 byte),
    when_partcp_eoy                            varchar2(100 byte),
    flex_credit_5000a_flag                     varchar2(1 byte),
    flex_credits_er_contrib                    varchar2(50 byte),
    fmla_flag                                  varchar2(1 byte),
    employee_elections                         varchar2(100 byte),
    include_participant_election               varchar2(100 byte),
    change_status_below_30                     varchar2(100 byte),
    change_status_special_annual_enrollment    varchar2(100 byte),
    include_fmla_lang                          varchar2(100 byte),
    change_status_dependent_special_enrollment varchar2(3 byte)
